import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import "./slender.css";
import { useGlitch } from "react-powerglitch";
import GlitchClip from "react-glitch-effect/core/GlitchClip";
import GlitchText from "react-glitch-effect/core/GlitchText";

const Slender = () => {
  const glitch = useGlitch({ hideOverflow: "true", shake: false });
  // shake: {
  //   velocity: 5;
  // }

  return (
    <GlitchClip onHover={false}>
      <div className="slender--container">
        <div className="slender--link">
          <GlitchText component="h1" duration={830}>
            SLENDER - GAME OVER
          </GlitchText>

          <Link to="/start">Start over</Link>
        </div>
      </div>
    </GlitchClip>
  );
};

export default Slender;
